package com.mbc.nol.community;

public class ComDTO {
	int comnum;
	String id, comtitle, comdetail, comimg;
	int comcnt;
	String comdate;
	public ComDTO() {
		super();
		// TODO Auto-generated constructor stub
	}
	public int getComnum() {
		return comnum;
	}
	public void setComnum(int comnum) {
		this.comnum = comnum;
	}
	public String getId() {
		return id;
	}
	public void setId(String id) {
		this.id = id;
	}
	public String getComtitle() {
		return comtitle;
	}
	public void setComtitle(String comtitle) {
		this.comtitle = comtitle;
	}
	public String getComdetail() {
		return comdetail;
	}
	public void setComdetail(String comdetail) {
		this.comdetail = comdetail;
	}
	public String getComimg() {
		return comimg;
	}
	public void setComimg(String comimg) {
		this.comimg = comimg;
	}
	public int getComcnt() {
		return comcnt;
	}
	public void setComcnt(int comcnt) {
		this.comcnt = comcnt;
	}
	public String getComdate() {
		return comdate;
	}
	public void setComdate(String comdate) {
		this.comdate = comdate;
	}
	
	
}
